import React from 'react';
import Cell from './Cell';


const Row = ( { row, setGrid, width }) => {

  return (
    <div style={{display: 'grid', textAlign: 'left', 
                backgroundColor: '#3f3a4e',
                gridTemplateColumns: 'repeat(75, 1fr)'}}>

      {row.map((cell, j) => {
        return <Cell cell={cell} key={j} 
                     setGrid={setGrid} 
                     width={width}
                     />
      })}
    </div>
  )
}

export default Row
